[v, c1, r, c2] = input(/\s+/);
['원형 피자, '조각 피자'][ Number( (v / c1) > (PI * r**2 / c2) ) ]
.log();

만나이 = (금년 - 생년) - (금월 < 생월 || (금월 == 생월 && 금일 < 생일));
연나이 = (금년 - 생년);
세는나이 = (1 + 금년 - 생년);

( (x < L) ? L : (L <= x && x <= R) ? x : R ).log();
// 또는
min(max(x, L), R).log();

정보 = { 완성: ({스택}) => {[x,y,z] = 스택; return x%y==y%z && y%z==z%x} };
input('\n', ' ').slice(1).mapleaves(Number)
.map(xyz => cartesian([1,1,1], xyz, 정보).length ).log('\n', ' ');

input('\n')
.reduce((exist,c) => {exist[c]++; return exist}, vector(10))
.reduce((s,c,i) => !(c%2) ? s : [...s, i], []).log('\n');

[a1, b1, b2, a2] = input(/\s+/).map(Number);
원정 = (a2 > b1) ? 'Persepolis' : (b1 > a2) ? 'Esteghlal' : 'Penalty';
승패 = (a1 + a2 > b1 + b2) ? 'Persepolis' : (b1 + b2 > a1 + a2) ? 'Esteghlal' : 원정; log(승패);

[해결, 유니온, 최고레벨] = input(' ').map(Number);
a = (1000 <= 해결); 
b = (8000 <= 유니온 || 260 <= 최고레벨);
['Bad', 'Good', 'Very Good'][a + a*b].log();

[제한, 속도] = input('\n').map(Number);
log(  (제한 < 속도)
                ? 'You are speeding and your fine is '
                        + ((속도 <= 제한 + 20)
                                ? '$100.'
                                : (속도 <= 제한 + 30)
                                        ? '$270.'
                                        : '$500.')
                : 'Congratulations, you are within the speed limit!'
);

[더듬이, 눈] = input('\n').map(Number);
if (3 <= 더듬이 && 눈 <= 4) log('TroyMartian');
if (더듬이 <= 6 && 2 <= 눈) log('VladSaturnian'); 
if (더듬이 <= 2 && 눈 <= 3) log('GraemeMercurian');

[a, b, sol, diff] = input(/\s+/).map(Number);
cnt = natural(a,b).filter(x => abs(sol - x) <= diff).length;
// 또는 cnt = max(0, min(b, sol+diff) - max(a, sol-diff) + 1);
log( cnt ? cnt : 'IMPOSSIBLE');

[a,x, b,y, t] = input('\n').map(Number);
log(  a + x*max(t-30, 0) * 21  );
log(  b + y*max(t-45, 0) * 21  );

[p1,q1, p2,q2] = input(' ').map(Number);
넓이 = (p1 * p2) / q1 / q2 / 2;
log( 넓이 == floor(넓이) ? 1 : 0 );

[kg, m] = input('\n').map(Number);
BMI = kg / m**2;
log(BMI > 25 ? 'Overweight' : BMI > 18.5 ? 'Normal weight' : 'Underweight');

예선: ({스택}, 가지) => (스택.length <= 0) || (스택.at(-1) * 가지 >= N);
발견: ({스택: [x, y]}) => x*y >= N; // 예선 또는 발견을 사용
가공: ({스택: [x, y]}) => [x+y, x, y];
cartesian([1,1], [N, N], 정보).해집합
.toSorted((a,b)=>a[0]-b[0]).thru(x => x[0].slice(1)).log(' ');

input('\n', ' ').slice(1).mapleaves(Number)
.map(([x,y,z]) => min(x,y,z)).log('\n');
// x=y=z 일 때만 조건이 성립함을 활용
